import React from 'react';
import styled from 'styled-components';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import {
  faInstagram,
  faBehanceSquare,
  faTelegramPlane,
  faLinkedin,
} from '@fortawesome/free-brands-svg-icons';
import devices from '../tools/mediaQueries';

const ContactList = styled.ul`
  list-style: none;
  display: flex;
  justify-content: space-between;
  align-items: center;
  width: 400px;

  @media ${devices.mobileL} {
    width: 200px;
  }
`;

const Contacts = props => {
  const { color, size } = props;
  return (
    <ContactList>
      <li>
        <a href="/">
          <FontAwesomeIcon size="4x" color={color} icon={faInstagram} className="icon" />
        </a>
      </li>
      <li>
        <a href="/">
          <FontAwesomeIcon size="4x" color={color} icon={faBehanceSquare} className="icon" />
        </a>
      </li>
      <li>
        <a href="/">
          <FontAwesomeIcon size="4x" color={color} icon={faTelegramPlane} className="icon" />
        </a>
      </li>
      <li>
        <a href="/">
          <FontAwesomeIcon size="4x" color={color} icon={faLinkedin} className="icon" />
        </a>
      </li>
    </ContactList>
  );
};

export default Contacts;
